import React, { Component } from 'react';
import {useSelector} from 'react-redux'
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';

import logo from '../img/logo-menu.png';
import profile from '../../../Compras/SobreCompras/img/star-blue.png'

import './styles.scss';

const userOld = useSelector(state => state.user.data.user);

class MenuMobile extends Component {

    render() {
        console.log(this.props.isLogged, "ta logado desgrama?")
        let MenuClass = "menuMobile";
        if (this.props.isOpen) {
            MenuClass += " open";
        }

        return(
            <nav className={ MenuClass }>
                <div className="headerContainer">
                    {this.props.isLogged ? (
                        <div className="contentHeader">
                            <img className="avatar" src={profile} alt="Imagem de perfil" />
                            <span className="nameUser">Hazel</span>
                            <span className="emailUser">rebecca.pantoja@email.com</span>
                        </div>
                    ) : (
                        <img src={logo} alt="Logo" />
                    )}
                </div>
                <Link className="mobileLinks" to="/">In√≠cio</Link>
                <Link className="mobileLinks" to="/">Como Jogar</Link>
                <Link className="mobileLinks" to="/regras">Regras</Link>
                <Link className="mobileLinks" to="/compras">Compre Stars</Link>
                <Link className="mobileLinks" to="/">Ranking</Link>
                <Link className="mobileLinks" to="/contato">Contato</Link>
                <Link className="mobileLinks" to="/cadastro">Participe</Link>
                {this.props.isLogged ? ( <Link className="mobileLinks" to="/logout">Sair</Link> ) : ( <Link className="mobileLinks" to="/login">Entrar</Link> )}
            </nav>
        );
    };
};

MenuMobile.propTypes = {
    isOpen: PropTypes.bool.isRequired
};

export default MenuMobile;
